import React from 'react'
import { useContext } from 'react'
import noteContext from '../Constaxt/notes/noteContext'
const About = () => {
  const a = useContext(noteContext)
  const {getallnotes} = a;
  return (
    <div>{getallnotes}</div>
  )
}

export default About
